script: |
  super -f text -I q6434.spq | sort > q6434.out

inputs:
  - name: q6434.spq
    data: |
      SELECT CAST ( col0 AS INTEGER ) AS col1, col2 * + 34 + - CAST ( - 10 AS INTEGER ) FROM tab0 (FORMAT parquet) AS cor0 WHERE - col2 * - - col0 + - col2 + - col2 + + - col0 IS NULL AND NOT ( 8 ) > NULL;
  - name: tab0

outputs:
  - name: q6434.out
    data: |
